import React from 'react'
import PropTypes from 'prop-types'

function TermName(props) {

  return (
   <button 
      onClick={props.onClick}
      style={{
        backgroundColor: 'white',
        height: props.height,
        

      }}
    >
    {props.children}
    </button>
  )
}

TermName.propTypes = {}

export default TermName
